function cleanBoard() {
    this.submorphs.forEach(function(ele) {
        var name = ele.getName();
        if ( name == "black" || name == "white" || name == "newGame" || name == "field" || name == "turn") {
            return;
        } else {
            ele.remove();
        }
    });
    for (var i = 0; i < this.gameboardWidth(); i++) {
        for (var j = 0; j < this.gameboardHeight(); j++) {
            var field = $morph("field").copy();
            field.setIndex(i,j);
            this.addMorph(field);
            field.setPosition(pt(i*25,j*25));
        }
    }
}

