function drawState(state) {
    this.cleanBoard();

    for(var i=0; i<8; i++) {
        for(var j=0; j<8; j++) {
                var field = $morph("field" + (i* 8 + j + 1));
                var valueOfField = state.gameboard[i][j];
                if(typeof valueOfField == "string") {
                    var stone = $morph(valueOfField).copy();
                    field.putStone(stone);
                }
            }
        }
    this.player = state.player;
    $morph("turn").changeTurn(state.player);
}

