function occupy(field) {
    var state = this.getState();
    var newState = state.getNextStateIfValidOnCoordinate(field.getIndexCol(),field.getIndexRow());
    if ( newState && typeof newState != "undefined") {
        this.drawState(newState);
    }else {
        field.onInValidPosition();
    }

}

6030.source:
function getState() {
  var gameboard = new Array();
   for(var i=0; i<8; i++) {
       var row = new Array();
       gameboard.push(row);
       for(var j=0; j<8; j++) {
         var field = $morph("field" + (i* 8 + j + 1));
         var stone = field.getStone();
         if(typeof stone != "undefined"){
             row[j] = stone.value();
         }
       }
    }

    var state = new ABPReversiState(gameboard, this.getPlayer(), this.getOtherPlayer());
    return state;
}

