function initialState() {
    var gameboard = new Array();
    for ( var i = 0; i < this.gameboardWidth() ; i++) {
        gameboard.push(new Array());
    }
    gameboard[3][3] = "black";
    gameboard[4][4] = "black";
    gameboard[3][4] = "white";
    gameboard[4][3] = "white";
